import React, {Component} from 'react';

class Profile extends Component {

    constructor(props) {
        super(props);
        this.state = {
            name: '',
            sid: 0,
            course: ''
        };
    }

    dummyProfile() {
        this.setState({
            name: 'Eyup Keskin',
            sid: 3686150,
            course: 'Bachelor of Software Engineering'
        })
    }

    render() {
        return (
            <div className="Profile">
                {this.dummyProfile()}
                <div>{this.state.name}</div>
            </div>
        )
    }

}

export default Profile;
